description:
I wrote this poem about an old, abandoned farm land and barnyard in the Lake City, SC area. Urban exploration and ghost hunting are both old hobbies of mine. &quot;Leave only footprints, take only pictures.&quot; This poem will be included in a future edition of my dimly lit book of poetry, Moonlit Journey.
